import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route} from "react-router-dom";
import Header from "./Header";

function App() {
  return (
    <div className="app">
      <Router>
      <>
        <Switch>
          <Route path="/" exact>
          <Header />
          </Route>
        </Switch>
      </>
    </Router>
    </div>
  );
}

export default App;
